<!DOCTYPE html>
<html>
    <head>
        <meta charset="UTF-8">

    </head>


<script>
function pulaLinha() {
    document.write("<br><br>");
}

function mostra(frase) {
    document.write(frase);
}

let numeroInicio=30;
let numeroFim=40;


while(numeroInicio<=numeroFim){
    if(numeroInicio!=33 && numeroInicio!=37){
    mostra(numeroInicio);
    pulaLinha();
    }
    numeroInicio=numeroInicio+1;
}
mostra("FIM");


</script>

</html>
